import React from 'react';

function About() {
    return (
        <div className="about-page">
            <h1>About Good Vibe News</h1>
            <p>Good Vibe News Malta is dedicated to sharing positive news and uplifting stories from around the world. Our mission is to spread good vibes and bring a smile to your face every day.</p>
            <p>We believe that there is always something good happening, and we strive to highlight those moments to inspire and motivate our readers.</p>
            <p>Thank you for supporting us and being a part of our community!</p>
        </div>
    );
}

export default About;
